function App() {
    const items = [
        {
            label: 'can i use react on projects',   
            content: 'NO'
        },
        {
            label: 'can i use JS on projects',   
            content: 'alwayss'
        },
        {
            label: 'can i use CSS on projects',   
            content: 'maybe'
        },
        
    ]


    return <Accordion />;
}

export default App;
